import React from 'react';
import {SingleLinks,DropDownLinks} from './PageLinks';
import ToggleDarkMode from './ToggleDarkMode';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import { Nav } from 'react-bootstrap';
import NavDropdown from 'react-bootstrap/NavDropdown';

const NavigationHeader = () => {
    return (
        <Navbar sticky="top">
            <Container>
                <Navbar.Brand className="justify-content-left">
                    BDO<br/>Tracker
                </Navbar.Brand>
                <Nav className="justify-content-center">
                {SingleLinks.map((item)=> {
                        return (
                            <Nav.Link className={item.cName} href={item.url}>{item.title}</Nav.Link>
                        )
                    })}

                    <NavDropdown title="Life Skills">
                        {DropDownLinks.map((item)=> {
                            return (
                                <Nav.Link className={item.cName} href={item.url}>{item.title}</Nav.Link>
                            )
                        })}
                    </NavDropdown>
                </Nav>
                <ToggleDarkMode/>

            </Container>
        </Navbar>

        );
    }

export default NavigationHeader
